package main

import (
	"fmt"
)

func main() {
	N := 14
	p1 := 0
	input := ""

	findFirstUniqueN:
	for i := 0; i < len(input); i+=1 {
		hash := make(map[string]int)
		for j, v := range input[i:i+N] {
			hash[string(v)] = j
		}
		if len(hash) == N {
			p1 = i + N
			break findFirstUniqueN
		}
	}

	fmt.Println(fmt.Sprintf("%s%d", "P1: ", p1))

}
